import Button from 'react-bootstrap/Button';
import Col from 'react-bootstrap/Col';
import Form from 'react-bootstrap/Form';
import Row from 'react-bootstrap/Row';
import React from 'react';
function AddVolunteering() {
  return (
    <Form>
        <Row className="mb-3">
        <Form.Group as={Col} controlId="formGridName">
          <Form.Label>Type Volunteering</Form.Label>
          {/* לשאול האם כדאי לעשות select */}
          <Form.Control type="text" placeholder="Enter type volunteering" />
        </Form.Group>
        <Form.Group as={Col} controlId="formGridName">
          <Form.Label>City</Form.Label>
          <Form.Control type="text" placeholder="Enter city" />
        </Form.Group>
        </Row>
      <Row className="mb-3">
        <Form.Group as={Col} controlId="formGridEmail">
          <Form.Label>זמן התחלה:</Form.Label>

          {/* <DateTimePicker onChange={onChange} value={value} />    */}
               </Form.Group>

        <Form.Group as={Col} controlId="formGridPassword">
          <Form.Label>זמן סיום:</Form.Label>
{/* <DateTimePicker onChange={onChange} value={value} /> */}
        </Form.Group>

    </Row>
   <Form.Group className="mb-3" controlId="formGridAddress1">
        <Form.Label>Address</Form.Label>
        <Form.Control placeholder="1234 Main St" type='text'/>
      </Form.Group>

    

      <Row className="mb-3">
    

        <Form.Group className="mb-3" controlId="exampleForm.ControlTextarea1">
        <Form.Label>Description</Form.Label>
        <Form.Control as="textarea" rows={3} type='text'/>
      </Form.Group>
      </Row>
<Button variant="primary" type="submit">
        Submit
      </Button>
    </Form>
  );
}

export default AddVolunteering;
